
const D3Node = require('d3-node');
const d3 = require('d3');
const fs = require('fs');

const MIN_ABUNDANCE = Math.log10(0.01);

const styles = `
.axis line, .axis path {
    shape-rendering: crispEdges;
    stroke: grey;
    fill: none;
}

circle {
    fill: black;
}
label { 
  font-size: 0.9em;
}
`;
const options = { svgStyles: styles, d3Module: d3 };
const margin = { top: 10, right: 10, bottom: 60, left: 80 },
    width = 760 - margin.left - margin.right,
    height = 500 - margin.top - margin.bottom;
/**
 *
 * @param abundances
 * @param highlightAbundance optional
 * @return {D3Node}
 */
function plot(data, d1Title, d2Title) {
  var d3n = new D3Node(options);

  var x = d3.scaleLinear()
    // .domain([-2.2, d3.max(data, function(d) { return d[0]; })])
    .domain([-2.2, 6])
    .range([ 0, width ]);

  var y = d3.scaleLinear()
    // .domain([-2.2, d3.max(data, function(d) { return d[1]; })])
    .domain([-2.2, 6])
    .range([ height, 0 ]);

  var chart = d3n.createSVG()
    .attr('width', width + margin.right + margin.left)
    .attr('height', height + margin.top + margin.bottom)
    .attr('class', 'chart')

  var main = chart.append('g')
    .attr('transform', 'translate(' + margin.left + ',' + margin.top + ')')
    .attr('width', width)
    .attr('height', height)
    .attr('class', 'main');

  function tickFormat(d)  {
    if (d === -2) { //0.01
      return '0.01';
    } else if (d === 6) { //1000000
      return '';
    }
    return Math.round(Math.pow(10, d));
  };
  // draw the x axis
  var axis = d3.axisBottom(x).ticks(4).tickFormat(tickFormat);
  main.append('g')
    .attr("class", "axis axis--x")
    .attr("transform", "translate(0," + height + ")")
    .call(axis);

  // draw the y axis
  var yaxis = d3.axisLeft(y).ticks(4).tickFormat(tickFormat);
  main.append('g')
    .attr("class", "axis axis--y")
    .call(yaxis);

  var g = main.append("svg:g");

  g.selectAll("scatter-dots")
    .data(data)
    .enter().append("svg:circle")
    .attr("cx", function (d,i) { return x(d[0]); } )
    .attr("cy", function (d) { return y(d[1]); } )
    .attr("r", 1);

  // now add titles to the axes
  chart.append("text")
    .attr("class", "x label")
    .attr("text-anchor", "middle")  // this makes it easy to centre the text as the transform is applied to the anchor
    .attr("transform", "translate("+ (width/2) +","+(height + margin.top + margin.bottom - 15 )+")")  // centre below axis
    .text(d1Title);

  chart.append("text")
    .attr("class", "y label")
    .attr("text-anchor", "middle")  // this makes it easy to centre the text as the transform is applied to the anchor
    .attr("transform", "translate("+ 20 +","+(height/2)+")rotate(-90)")  // text is drawn off the screen top left,
    .text(d2Title);

  return d3n;
}


function correlate(d1, d2, nogs) {
  var data = [];
  nogs.forEach(c => {
    var x = sumOrthgroupAbundances(c, d1);
    var y = sumOrthgroupAbundances(c, d2);
    //for correlation orthgroup has to have abundances for both species
    // if (!BigDecimal.ZERO.equals(x) && !BigDecimal.ZERO.equals(y)) {
    if (!(0 === x) && !(0 === y)) {
      var yab = Math.log10(y);
      var xab = Math.log10(x);
      if (xab >= MIN_ABUNDANCE && yab >= MIN_ABUNDANCE) {
        data.push([xab, yab]);
      }
    }
  });

  return data;
}

function sumOrthgroupAbundances(nog, dataset) {
  var sum = 0.0;
  //TODO find a Decimal JavaScript class
  nog.members.forEach(p => {
    if (p in dataset) {
      sum += dataset[p].a;
    }
  });
  return sum;
}


if (typeof module !== 'undefined' && module.exports) { // Node.js
  module.exports.plot = plot;
  module.exports.correlate = correlate;
} else if (typeof define !== 'undefined' && define.amd) { // eslint-disable-line no-undef
  // AMD / RequireJS
  define([], function amddefinemod() { // eslint-disable-line no-undef, prefer-arrow-callback
    return makeScatter;
  });
} else {  // included directly via <script> tag
  root.makeScatter = makeScatter;
}

